import React from 'react'

function Todosave({todos, handleDelete}) {

  return (
    <div>
        {
            todos.map((todo,index)=>
            <div key={index}>
                <h5>{todo} <span/> <button class onClick={()=> handleDelete(index)}>Delete</button></h5>
            </div>)
        }
    </div>
    )
}

export default Todosave;
